import React from 'react';
import './ventes.css';

const ProductCard = ({ product }) => {
 return (
    <div className="product-card">
      <img src={process.env.PUBLIC_URL + product.image} alt={product.name} className="product-image" />
      <div className="product-info">
        <h3>{product.name}</h3>
        <p>{product.description}</p>
        <p>{product.price} DA</p>
      </div>
    </div>
 );
};

const Ventes = () => {
  const products = [
    {
      name: 'Violon',
      description: 'Description du violon',
      price:  20,
      image: '/violonphoto.jpg' // Updated path
    },
    {
      name: 'Guitare',
      description: 'Description de la guitare',
      price:  15,
      image: '/guitarephoto.jpg' // Updated path
    },
    // Add other products here
  ];

 return (
    <div className="ventes-container">
      {products.map((product, index) => (
        <ProductCard key={index} product={product} />
      ))}
    </div>
 );
};

export default Ventes;
